                            Abstract = @"Over a decade ago, Pat Helland authored his paper, ""Life Beyond Distributed Transactions: An Apostate's Opinion"" describing a means to coordinate activities between entities in databases when a transaction encompassing those entities wasn't feasible or possible. While the paper and subsequent talks provided great insight in the challenges of coordinating activities across entities in a single database, implementations were left as an exercise to the reader!

